@java.lang.SuppressWarnings("fallthrough")
private void beforeValue(boolean root) throws java.io.IOException {
    switch (peek()) {
        case com.google.gson.stream.JsonScope.NONEMPTY_DOCUMENT :
            if (!lenient) {
                throw new java.lang.IllegalStateException("JSON must have only one top-level value.");
            }
        case com.google.gson.stream.JsonScope.EMPTY_DOCUMENT :
            if ((!lenient) && (!root)) {
                throw new java.lang.IllegalStateException("JSON must start with an array or an object.");
            }
            replaceTop(com.google.gson.stream.JsonScope.NONEMPTY_DOCUMENT);
            break;
        case com.google.gson.stream.JsonScope.EMPTY_ARRAY :
            replaceTop(com.google.gson.stream.JsonScope.NONEMPTY_ARRAY);
            newline();
            break;
        case com.google.gson.stream.JsonScope.NONEMPTY_ARRAY :
            out.append(',');
            newline();
            break;
        case com.google.gson.stream.JsonScope.DANGLING_NAME :
            out.append(separator);
            replaceTop(com.google.gson.stream.JsonScope.NONEMPTY_OBJECT);
            break;
        default :
            throw new java.lang.IllegalStateException("Nesting problem.");
    }
}

